import React, {Component} from 'react';
import {NavLink} from 'react-router-dom';
import NavLinks from './NavLinks'

// import DropdownMenu from './Dropdownmenu';

class NavBar extends Component {
    constructor(props){
        super(props)
        this.state = {dropdownMenu: false}
    }
    // <NavLink className="logo_sprite" to="/" activeClassName="hurray"></NavLink>

    render(){
        return (
            <div className="index_buttons">
              <button BG-color='green' onClick={() => {this.setState({dropdownMenu: !this.state.dropdownMenu})}}>hi</button>

              {this.state.dropdownMenu ? <NavLinks /> : ""}
            </div>
        )
    }
}

export default NavBar
